import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/userHome.css'; // 假设您的样式文件名为 navBar.css

function UserHome() {
    const username = "User"; // 假设从状态或 props 中获取用户名

    return (
        <div className="home-container">
            <nav className="navbar">
                <div className="nav-brand">Welcome to Belay</div>
                <div className="nav-items">
                    <Link to="/home" className="nav-link">Home</Link>
                    <Link to="/profile" className="nav-link">Profile</Link>
                    <Link to="/channel" className="nav-link">Channel</Link>
                    <Link to="/logout" className="nav-link">Logout</Link>
                </div>
                <div className="nav-user">
                    <button className="username-button">{username}</button>
                </div>
            </nav>
            <h1>This is the UserHome</h1>
        </div>
    );
}

export default UserHome;
